 /**--机车牵引费--*/
 IF EXISTS (SELECT * FROM sysobjects WHERE type = 'U' AND name = 'newtrainqianyinfee')
	BEGIN
		DROP  Table newtrainqianyinfee
	END
GO

CREATE TABLE newtrainqianyinfee
(
   
  num       integer not null primary key ,			--序号
  byear     integer not null,						--年份
  bmonth    integer not null,						--月份
  trainname varchar(50) not null,					--车次
  astation  varchar(50) not null,					--始发站
  bstation  varchar(50) not null,					--终到站
  zl1       numeric(18,2),							--本企业万总重吨公里
  zl2       numeric(18,2),							--外企业(国铁)万总重吨公里
  zl3       numeric(18,2),							--外企业(非国铁)万总重吨公里
  fee1      numeric(18,2),							--本企业应付余额
  fee2      numeric(18,2),							--外企业(国铁)应付余额
  fee3      numeric(18,2)							--外企业(非国铁)应付余额

)
GO



